import React from "react";
function Card(props) {
    return (
        <>
        <div></div>
            <div className='card_container'>
                <div className='img'>
                    <img src={props.imgsrc} alt='image'></img>
                </div>
                <h4>{props.ctitle}</h4>
                <h3>{props.stitle}</h3>
                <button>Watch Now</button>
            </div>
        </>
    )
}

export default Card;
